import "./App.css";
import React, { Component } from "react";
import Nav from "./components/Nav";
import Body from "./components/Body";
import Footer from "./components/Footer";

function App() {
  return (
    <div class="container">
      <div class="row">
        <div class="col">
          <Nav />
        </div>
        <div class="col-6">
          <Body />
        </div>
        <Footer />
      </div>
    </div>
  );
}

export default App;
